import './App.css';
import { Route, Routes, BrowserRouter } from "react-router-dom";
import RegistroPonto from './RegistroPonto';
import Geolocalizacao from './Geolocalizacao';

function App() {
  return (
      <BrowserRouter>
        <Routes>
        <Route component = { RegistroPonto }  path=""  />
           <Route component = { Geolocalizacao }  path="/geolocalizacao" />
        </Routes>

      </BrowserRouter>
  );
}

export default App;
